import React from "react";
import { View, TouchableOpacity, Text } from "react-native";
import StylePasswordHeader from "./StylePasswordHeader";


const PasswordHeader = ()=>{
    return<View style={StylePasswordHeader.header}>
        <View style = {StylePasswordHeader.headerConteiner}>
            <TouchableOpacity style={StylePasswordHeader.button}><Text>but</Text></TouchableOpacity>
            <Text>Lock code</Text>
        </View>
    </View>
}

export default PasswordHeader;
